import React, { Component } from 'react';

import Button from './compornents/Button';

class App extends Component {

  constructor(){
    super();
    this.state = {
      count: 0
    }
  }

  render() {
    return (
      <div>
        <p>{this.state.count}</p>
        <button>+1</button>
        <button>-1</button>
        <hr/>
        <Button label="完了" />
        <Button label="削除" />
      </div>
    );
  }
}

export default App;
